import{_ as e,c as a,o as i,a as t}from"./app.5c823684.js";const p='{"title":"Overview","description":"","frontmatter":{},"headers":[{"level":2,"title":"Survey/Recall interface","slug":"survey-recall-interface"},{"level":2,"title":"Admin interface","slug":"admin-interface"},{"level":2,"title":"API service","slug":"api-service"},{"level":2,"title":"Database","slug":"database"},{"level":2,"title":"CLI","slug":"cli"}],"relativePath":"overview/index.md","lastUpdated":1642520690024}',s={},r=t('<h1 id="overview" tabindex="-1">Overview <a class="header-anchor" href="#overview" aria-hidden="true">#</a></h1><p>Intake24 dietary recall system</p><p>It is comprised of following parts:</p><ul><li>Survey/Recall interface</li><li>Admin interface</li><li>API Service</li><li>Databases containing: system data and food data</li><li>CLI</li></ul><h2 id="survey-recall-interface" tabindex="-1">Survey/Recall interface <a class="header-anchor" href="#survey-recall-interface" aria-hidden="true">#</a></h2><p>Users can access the survey interface to complete their dietary recall. This is generated dependent on the configuration of the survey, done in the admin interface.</p><p>A demo survey is available, where users can be dynamically generated. Most users will access the survey using a user account or via a link.</p><h2 id="admin-interface" tabindex="-1">Admin interface <a class="header-anchor" href="#admin-interface" aria-hidden="true">#</a></h2><p>Allows for administration of surveys, including user accounts. Surveys are based on schemes, which dictate the question structure and other aspects of the survey. A scheme also uses a specific food list, and is thus used for localisation.</p><h2 id="api-service" tabindex="-1">API service <a class="header-anchor" href="#api-service" aria-hidden="true">#</a></h2><p>Serves data from the database for the front end interfaces (admin and survey).</p><h2 id="database" tabindex="-1">Database <a class="header-anchor" href="#database" aria-hidden="true">#</a></h2><p>Built on PostgreSQL, there are two databases: <code>system</code> and <code>foods</code>, storing the system data (users, recalls, surveys, schemes) and food lists respectively.</p><h2 id="cli" tabindex="-1">CLI <a class="header-anchor" href="#cli" aria-hidden="true">#</a></h2><p>Command line tool with various useful commands / scripts.</p>',15),n=[r];function c(d,l,o,h,u,f){return i(),a("div",null,n)}var m=e(s,[["render",c]]);export{p as __pageData,m as default};
